description:
Monty Python - Jabberwocky (1977)

geregisseerd door Terry Gilliam
met Michael Palin, Harry H. Corbett en John Le Mesurier



Na de dood van zijn vader gaat de jonge Dennis Cooper naar de stad waar hij enkele avonturen moet doorstaan. De stad en het koninkrijk worden bedreigd door een verschrikkelijk monster genaamd 'Jabberwocky'.




A young peasant, with no interest in adventure or fortune, is mistaken as the kingdom's only hope when a horrible monster threatens the countryside.

